import React, { useState } from 'react';
import Card from '@material-ui/core/Card';
import CardContent from '@material-ui/core/CardContent';
import Button from '@material-ui/core/Button';
import FormControl from '@material-ui/core/FormControl';
import TextField from '@material-ui/core/TextField';
import Typography from '@material-ui/core/Typography';
import styled from "styled-components";
import { makeStyles } from '@material-ui/core/styles';
import CardMedia from '@material-ui/core/CardMedia';
import CardActionArea from '@material-ui/core/CardActionArea';
import CardActions from '@material-ui/core/CardActions';
import BgImage from './_assets/bg3.jpg';
import Novisync from './_assets/Novisync.png';
import Bigapp from './_assets/bigapp.png';
import ThumbUpAltIcon from '@material-ui/icons/ThumbUpAlt';
import Degree1 from './_assets/degree1.png';
import Degree2 from './_assets/degree2.png';
import Degree3 from './_assets/degree3.png';




const MainDiv = styled.main`

@media (max-width: 768px) {
    width:100%;
    margin:15px;

  }
  @media (max-width: 458px) {

  }
  @media (width: 375px) {

  }
  @media (width: 425px) {

  }

`;


//card 1

const MainCard = styled(Card)`

@media (max-width: 768px) {
    width:90%;
    margin:0px;
    // margin-right:50px;

  }
  @media (max-width: 458px) {

  }
  @media (width: 375px) {

  }
  @media (width: 425px) {

  }

`;

const ContentDiv = styled.div`
margin-top:120px;

@media (max-width: 768px) {
    width:100%;
    margin:0px;

  }
  @media (max-width: 458px) {

  }
  @media (width: 375px) {

  }
  @media (width: 425px) {

  }
`;

const CardContentDiv = styled(CardContent)`
    background-color:#F8F9F9;
    // background-image: url(${BgImage});
    height:300px;
    @media (max-width: 768px) {
        width:100%;
        margin:0px;
        height:300px;
      }
      @media (max-width: 458px) {

      }
      @media (width: 375px) {

      }
      @media (width: 425px) {

      }   
`;

const TextDiv = styled.h1`
font-family:Impact, fantasy;
color:#212F3D;
`;
const TextDiv1 = styled.h3`
font-family:Courier New, monospace; 
color:#212F3D;
`;

const Break = styled.div`
margin-bottom:20px;

`

const TextDiv3 = styled.h5`
font-weight:500px;
font-size:30px;
font-family:Impact, fantasy;
color:#212F3D;
`;


//text

const TitleDiv1 = styled.div`
float:left;
margin-left:200px;
`;

const TitleDiv2 = styled.div`
float:right;
margin-right:200px;
`;

const HeaderTag1 = styled.h3`
font-family:Impact, fantasy;
margin-left:10px;
`;

const SideHeaderTage = styled.p`

font-family:Palatino, serif;
font-size:20px;
margin-right:80px;
margin-left:33px;
// font-weight:500px;
`;

const Logo1 = styled.img`
width : 300px;
// float:right;
margin-right:100px;
`;

const Logo2 = styled.img`
width : 200px;
// float:right;
margin-right:100px;
`;

const BorderDiv = styled.div`
padding:5px;
border-style: solid;
  border-width: 1px;
  border-radius:13px;
  border-color:#85929E;
`;

const ThumbUpAltIconTag = styled(ThumbUpAltIcon)`
float:left;
margin-top:2px;
margin-right:10px;
`;

const TypographyDiv = styled(Typography)`
`;
//education

const EducationDiv = styled.div`
margin-top:450px
`;

const DegreeDiv = styled.div`
border-style: solid;
  border-width: 1px;
  border-radius:13px;
  margin-left:400px;
  margin-right:400px;
`;

const ImageDiv = styled.img`
width:100px;
margin-left:352px;
margin-top:25px;
position:absolute;
`

function PortFolio(props) {

  return (
    <MainDiv>
      <MainCard >
        <CardContentDiv>
          <ContentDiv> </ContentDiv>
          <center>
            <TextDiv>
              Hi I'm Sethu Kumar
                 </TextDiv>
            <TextDiv1>
              React Web Developer(React,Redux,Mobx,Html,Css,Javascript)
                 </TextDiv1>
          </center>
        </CardContentDiv>
      </MainCard>
      <Break />
      <center>
        <TypographyDiv>
          <TextDiv3>
            Work Experience
                    </TextDiv3>
        </TypographyDiv>
      </center>
      <Break />

      <TitleDiv1>
        <Logo1 src={Bigapp} />
        <HeaderTag1>
          Project :
            </HeaderTag1>

        <BorderDiv>
          <TypographyDiv>
            <ThumbUpAltIconTag />
            <SideHeaderTage>
              Curio Travel and Expense.
            </SideHeaderTage>
          </TypographyDiv>
        </BorderDiv>
        <Break />
      </TitleDiv1>
      <TitleDiv2>

        <Logo2 src={Novisync} />
        <HeaderTag1>
          Projects :
            </HeaderTag1>

        <BorderDiv>
          <TypographyDiv>
            <ThumbUpAltIconTag />
            <SideHeaderTage>
              NExam-Online Test Project.
            </SideHeaderTage>
          </TypographyDiv>
          <Break />

          <TypographyDiv>
            <ThumbUpAltIconTag />
            <SideHeaderTage>
              Novisync & Cadrac Labs Websites.
            </SideHeaderTage>
          </TypographyDiv>
          <Break />

          <TypographyDiv>
            <ThumbUpAltIconTag />
            <SideHeaderTage>
              Jobbuzz.
            </SideHeaderTage>
          </TypographyDiv>
        </BorderDiv>
      </TitleDiv2>

      <Break />
      <EducationDiv>
        <center>
          <TypographyDiv>
            <TextDiv3>
              Education & Qualification
            </TextDiv3>
          </TypographyDiv>
        </center>
        <Break />
      </EducationDiv>

     <ImageDiv src={Degree1} />
      <DegreeDiv>    
        <center>
            <p>Degree: Bachelor of technology</p>
            <p>University : JNTU Ananthapur</p>
            <p>Branch: Mechanical Engineering</p>
            <p>Aggregate: 75%</p>
        </center>
      </DegreeDiv>

      <ImageDiv src={Degree2} />
      <DegreeDiv>    
        <center>
            <p>Degree: Intermediate</p>
            <p>University : Board of intermediate</p>
            <p>Group: M.P.C</p>
            <p>Aggregate: 85%</p>
            </center>
      </DegreeDiv>

      <ImageDiv src={Degree3} />
      <DegreeDiv>    
        <center>
            <p>Degree: S.S.C</p>
            <p>University : Board of Secondary</p>
            <p>Group: M.P.C</p>
            <p>Aggregate: 85%</p>
            </center>
      </DegreeDiv>


    </MainDiv>
  );
}

export default PortFolio;
